import React from "react";
import Footer from "./layout/footer";
import Header from "./layout/header";
import Employee from "./Employee";
import { Link } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Header/>
        <main>
          <Link to="/about-us"></Link>
          <div className='container'>
            <Employee />
          </div>
        </main>
      <Footer />
    </div>
  );
}

export default App;

















